  \"2015-09-26T21:12:44.361957\",\n\t\"name\": \"submarine-upward-looking-sonar-ice-draft-profile-data-and-statistics\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"nThis data set consists of upward looking
  sonar draft data collected by submarines in the Arctic Ocean.  It includes data
  from both U.S. Navy and Royal Navy submarines. Maps showing submarine tracks are
  \ available.  Data are provided as ice draft profiles and as statistics derived
  from the profile data. Statistics files include information concerning ice draft
  characteristics, keels, level ice, leads, un- deformed and deformed ice.  Data from
  the U.S. Navy's Digital Ice Profiling System (DIPS) have been  interpolated and
  processed for release as unclassified data at the U.S. Army's Cold Regions Research
  \ and Engineering Laboratory (CRREL) in Hanover, New Hampshire. Data from the analog
  draft recording  system were digitized and then processed by the Polar Science Center,
  Applied Physics Laboratory,  University of Washington.   Data from British submarines
  were provided by the Department of Applied Mathematics and Theoretical Physics,
  University of Cambridge. All data sources used similar processing methods in order
  to ensure  a consistent data set.Access to the Submarine Upward Looking Sonar Ice
  Draft Profile Data and Statistics data set is  unrestricted, but users are encouraged
  to register for the data. Registered users will receive e-mail notification about
  any product changes.n\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
